import React from "react";

const EventsMain = () => {
    return (
        <div className="page" >
          <div style={{display: "flex"}}>
              <EventsCard title={"Casas abiertas"}/>
              <EventsCard title={"Competencias"}/>
              <EventsCard title={"Sociales"}/>
              <EventsCard title={"JISIC"}/>
              <EventsCard title={"ICI2ST"}/>
          </div>
        </div>
    );

};
const EventsCard = (props) =>{
    return <div className={"events-card-container"}>
            <img src={""} alt={""}/>
        <div>{props.title}</div>
    </div>
}

export default EventsMain;
